import React from "react";
import '../styles/utility-styles.css'
import '../styles/text-styles.css'
import { Col, Container, Row } from "react-bootstrap";
import Button from "react-bootstrap/Button";
import NavBar from "../components/NavBar";
import Footer from "../components/Footer";

const PersonalAccount = () => {
    return (
        <>
        <NavBar/>
       
                    <div className='block-Standart' style={{marginTop:'10%'}}>
                        <div className="display-1">
                        Личный кабинет
                        </div>
                        <Button className='button-3 mt-2' style={{border:'none', minWidth:'15%', fontSize:'16px', minHeight:'47px', fontWeight:'700', marginLeft:'5%'}}>
                            Сохранить изменения
                        </Button>
                    </div>
                    <div className="body-Bold" style={{color:'#1F674F', marginLeft:'25.5%', marginTop:'50px'}}>
                        Информация
                    </div>
        <Footer/>
        </>
    );
};

export default PersonalAccount;
